	{name='B07_22',objType='LDImage',class='',width=32,height=16,x=122,y=316,xScale=0.5*1,yScale=0.5*1,assetName='B07_20',
		rotation=45,enableDrag=false,anchorX=0.5,anchorY=0.5,alpha=1,isVisible=true,blendMode='normal',
		userProps = {{name= 'tipo', value='unbreak' },},
		},
	{name='B07_23',objType='LDImage',class='',width=32,height=16,x=198,y=316,xScale=0.5*1,yScale=0.5*1,assetName='B07_20',
		rotation=-45,enableDrag=false,anchorX=0.5,anchorY=0.5,alpha=1,isVisible=true,blendMode='normal',
		userProps = {{name= 'tipo', value='unbreak' },},
